import React from 'react';
import styles from './Actions.module.scss';

const options = [
    {
        name: 'music',
        icon: '<svg stroke="currentColor" fill="none" stroke-width="2" viewBox="0 0 24 24" stroke-linecap="round" stroke-linejoin="round" class="iconbtn" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M9 18V5l12-2v13"></path><circle cx="6" cy="18" r="3"></circle><circle cx="18" cy="16" r="3"></circle></svg>'
    }
]

function Actions() {
  return (
    <div className={styles.actions}>
        {options.map(el => (
            <div className={styles.actions__button}> 
                {el.icon}
                {el.name}
            </div>
        ))}
    </div>
  )
}

export default Actions
